import React from 'react';
import Post from './Post';

const PostList = ({ posts }) => {
  return (
    <div>
      {
        posts.map((user, i) => {
          return (
            <Post
              key={i}
              id={posts[i].id}
              name={posts[i].title}
              email={posts[i].description}
              />
          );
        })
      }
    </div>
  );
}

export default PostList;
